const keyboard = 'qwertyuiopasdfghjklzxcvbnm'
let answer = words[Math.ceil(Math.random() * words.length) - 1]
// answer = 'langi'
console.log(answer)

const wordContainer = document.querySelectorAll('.word-container')
const keyboardLetter = document.querySelectorAll('.letter')

const colorRegular = 'bg-slate-400'
const colorRight = 'bg-green-400'
const colorWarning = 'bg-yellow-400'
const colorBlank = 'bg-slate-800'
const border = 'border-red-500'


window.addEventListener('keyup', function(e) {
    setText(e.key)
})

keyboardLetter.forEach(letter => {
    letter.addEventListener('click', e => {
        setText(letter.getAttribute('data-l'))
    })
})

function setText(key) {
    if (keyboard.includes(key.toLowerCase())) {
        const container = getFinishContainer()
        if (!container) return alert('Game Habis')
        const word = getFinishWord(container)
        if (!word) return
        word.textContent = key.toUpperCase()
        word.classList.add('avail')
        if (word.previousElementSibling) word.previousElementSibling.classList.remove(border)
        word.classList.add(border)

    } else if (key === 'Backspace') {
        const container = getFinishContainer()
        if (!container) return alert('Game Habis')
        const word = getLastAvail(container)
        if (!word) return 
        word.textContent = ''
        word.classList.remove(border)
        if (word.previousElementSibling) word.previousElementSibling.classList.add(border)
        word.classList.remove('avail')

    } else if (key === 'Enter') {
        const container = getFinishContainer()
        if (!container) return alert('Game Habis')
        const answerFromContainer = getAnswer(container).toLowerCase()
        if (answerFromContainer.length !== 5) return

        if (words.includes(answerFromContainer)) {
            const oldWord = document.querySelector(`.${border}`)
            oldWord.classList.remove(border)
            checkAnswer(answerFromContainer, container)
            container.classList.add('finish')
            const newContainer = getFinishContainer()
            if (newContainer) newContainer.children[0].classList.add(border)
            if (answerFromContainer === answer) {
                return alert('Anda Berhasil')
                // return reset()
            }
        } else {
            alert('Nda Ada Bosss')
        }
    }
}


function getFinishContainer() {
    for (const container of wordContainer) {
        if (!container.classList.contains('finish')) return container
    }
    return false
}

function getFinishWord(container) {
    for (const word of container.children) {
        if (!word.classList.contains('avail')) return word
    }
    return false
}

function getAnswer(container) {
    let result = ''
    for (const word of container.children) {
        if (!word.classList.contains('avail')) break
        result += word.textContent
    }
    return result
}

function getLastAvail(container) {
    let result
    for (const word of container.children) {
        if (!word.classList.contains('avail')) return result
        result = word
    }
    return result
}

async function checkAnswer(answerFromContainer, container) {
    let iteration = 0
    let delay = 400
    for (const word of container.children) {
        word.style.animation = `flip 800ms ${delay}ms`
        await sleep(delay)
        const letter = word.textContent.toLowerCase()
        word.classList.remove(colorRegular)
        const keyboardChange = searchKeyboard(letter)
        keyboardChange.classList.remove('bg-slate-500')
        if (answer.includes(letter)) {
            // if (answerFromContainer.indexOf(letter) === answer.indexOf(letter)) {
            if (letter === answer.charAt(iteration)) {
                if (keyboardChange.classList.contains(colorWarning)) keyboardChange.classList.remove()
                word.classList.add(colorRight)
                keyboardChange.classList.add(colorRight)
            } else {
                word.classList.add(colorWarning)
                if (!keyboardChange.classList.contains(colorRight)) {
                    keyboardChange.classList.add(colorWarning)
                }
            }
        } else {
            word.classList.add(colorBlank)
            keyboardChange.classList.add(colorBlank)
        }
        iteration += 1
        // delay += 400
    }
}

function reset() {
    for (const container of wordContainer) {
        if (container.classList.contains('finish')) container.classList.remove('finish')
        
        for (const word of container.children) {
            if (!word.classList.contains(colorRegular)) {
                if (word.classList.contains(colorBlank)) word.classList.remove(colorBlank)
                if (word.classList.contains(colorRight)) word.classList.remove(colorRight)
                if (word.classList.contains(colorWarning)) word.classList.remove(colorWarning)
                word.classList.add(colorRegular)
                word.textContent = ''
            }
            if (word.classList.contains(border)) word.classList.remove(border)
            if (word.classList.contains('avail')) word.classList.remove('avail')
            word.style.animation = ''
        }
    }

    for (const keyboard of keyboardLetter) {
        if (!keyboard.classList.contains('bg-slate-500')) {
            if (keyboard.classList.contains(colorBlank)) keyboard.classList.remove(colorBlank)
            if (keyboard.classList.contains(colorRight)) keyboard.classList.remove(colorRight)
            if (keyboard.classList.contains(colorWarning)) keyboard.classList.remove(colorWarning)
            keyboard.classList.add('bg-slate-500')
        }
    }
    answer = words[Math.ceil(Math.random() * words.length) - 1]
    console.log(answer)
}

function searchKeyboard(key) {
    return document.querySelector(`[data-l="${key.toLowerCase()}"]`)
}

function sleep(delay) {
    return new Promise(resolve => setTimeout(resolve, delay))
}
